export function fetchPeople(
    { maxDelay, errorRate } = {
      maxDelay: DEFAULT_MAX_DELAY,
      errorRate: DEFAULT_ERROR_RATE
    }
  ) {
    function getPeople() {
      return people;
    }
    if (nextIsSuccess) {
      errorRate = 0;
    } else {
      errorRate = 1;
    }
    nextIsSuccess = !nextIsSuccess;
    return mockFetch({ maxDelay, errorRate }, getPeople);
  }
